from unittest import TestCase

from exams.exams1.Exam23 import count_black_blocks


class TestExam(TestCase):

    def test_count_black_blocks1(self):
        coordinates = [[0, 0]]
        result = count_black_blocks(3, 3, coordinates)

        expected = [3, 1, 0, 0, 0]
        self.assertListEqual(expected, result)

    def test_count_black_blocks2(self):
        coordinates = [[0, 0], [1, 1], [0, 2]]
        result = count_black_blocks(3, 3, coordinates)

        expected = [0, 2, 2, 0, 0]
        self.assertListEqual(expected, result)

    # 第 1 次提交结果错误
    def test_count_black_blocks3(self):
        coordinates = [[17, 29], [29, 16], [19, 20], [18, 9], [16, 7], [20, 25], [22, 19], [4, 9], [14, 17], [6, 23],
                       [2, 2], [20, 1], [8, 7], [4, 7], [14, 14], [10, 10], [1, 27], [18, 23], [6, 30], [8, 18],
                       [26, 23], [25, 8], [5, 6], [3, 4]]
        result = count_black_blocks(32, 32, coordinates)

        expected = [866, 94, 1, 0, 0]
        self.assertListEqual(expected, result)

